import React, { Component } from 'react';
import Newsitem from './Newsitem';

export class News extends Component {

    constructor() {
        super();
        this.state = {
            results: [],       // yeh array hai, taaki map chale
            loading: false,
            page: 1,
            totalResults: 0
        };
    }

    fetchNews = async (page = 1) => {
        const apiKey = "pub_72692494882bef87a2c188de035ca6c17eccd";
        const url = `https://newsdata.io/api/1/news?apikey=${apiKey}&country=in&language=en&page=${page}&size=9`;

        this.setState({ loading: true });

        try {
            const response = await fetch(url);
            const data = await response.json();

            if (data.status === 'success') {
                this.setState({
                    results: data.results || [],   // ensure array
                    totalResults: data.totalResults || 0,
                    page: page,
                    loading: false
                });
            } else {
                console.error('API Error:', data);
                this.setState({ results: [], loading: false });  // error aayi to empty array
            }
        } catch (error) {
            console.error('Fetch failed:', error);
            this.setState({ results: [], loading: false });  // network error me bhi empty
        }
    };

    componentDidMount() {
        this.fetchNews(1);  // jab page load ho, pehli baar
    }

    handleNextClick = () => {
        if (this.state.page + 1 <= Math.ceil(this.state.totalResults / 9)) {
            this.fetchNews(this.state.page + 1);
        }
    }

    handlePrevClick = () => {
        if (this.state.page > 1) {
            this.fetchNews(this.state.page - 1);
        }
    }

    render() {
        return (
            <div className='container my-3'>
                <h2 className='text-center'><b>Aaj Tak - Top Headlines</b></h2>

                {this.state.loading && <h5 className='text-center'>Loading...</h5>}

                <div className="row">
                    {this.state.results.length > 0 ? (
                        this.state.results.map((element) => (
                            <div className='col-md-4 my-3' key={element.link}>
                                <Newsitem
                                    title={element.title || "No Title Available"}
                                    Description={element.description || "No Description Available"}
                                    imageUrl={element.image_url || 'https://via.placeholder.com/400'}
                                    newsUrl={element.link}
                                />
                            </div>
                        ))
                    ) : (
                        !this.state.loading && <h5 className='text-center'>No News Found</h5>
                    )}
                </div>

                <div className="d-flex justify-content-between">
                    <button disabled={this.state.page <= 1} onClick={this.handlePrevClick} className="btn btn-dark">
                        &larr; Previous
                    </button>
                    <button disabled={this.state.page + 1 > Math.ceil(this.state.totalResults / 9)} onClick={this.handleNextClick} className="btn btn-dark">
                        Next &rarr;
                    </button>
                </div>
            </div>
        );
    }
}

export default News;
